package com.atirodeas.crud;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;

import com.atirodeas.crud.models.Product;
import com.atirodeas.crud.services.ProductService;

@SpringBootApplication
public class CrudApplication implements CommandLineRunner {

	@Autowired
	private final ProductService productService;

	public CrudApplication(ProductService productService) {
		this.productService = productService;
	}

	public static void main(String[] args) {
		SpringApplication.run(CrudApplication.class, args);
	}

	@Override
	public void run(String... args) throws Exception {
		System.out.println("Application Started !!");
		productService.deleteAll();
		System.out.println("All items removed");
		for (int i = 1; i < 21; i++) {
			String name = "Balón " + i;
			String category = "Balones " + i;
			String description = "Balón " + i;
			Float price = Float.parseFloat("2000" + i);
			Boolean availability = true;
			Integer stockQuantity = i;			
			String imageUrl = "data:image/jpeg;base64,";
			Product product = new Product(name, category, description, price, availability, stockQuantity, imageUrl);
			productService.addProduct(product);
			
		}
		System.out.println("All items added");
	}

}
